import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Webhooks = () => {
    const [webhookUrl, setWebhookUrl] = useState(''); // Would fetch from API in real app
    const [secret, setSecret] = useState('whsec_test_abc123'); // Demo value
    const [logs, setLogs] = useState([]);
    const [loading, setLoading] = useState(false);

    // Mock API Base
    const API_URL = 'http://localhost:8000/api/v1';
    
    // Auth Headers (Demo)
    const headers = { 
        'X-Api-Key': 'key_test_abc123',
        'X-Api-Secret': 'secret_test_xyz789'
    };

    const fetchLogs = async () => {
        try {
            const res = await axios.get(`${API_URL}/webhooks`, { headers });
            setLogs(res.data.data);
        } catch (err) {
            console.error('Error fetching logs', err);
        }
    };

    useEffect(() => {
        fetchLogs();
    }, []);

    const handleRetry = async (id) => {
        try {
            await axios.post(`${API_URL}/webhooks/${id}/retry`, {}, { headers });
            alert('Retry scheduled');
            fetchLogs();
        } catch (err) {
            console.error('Retry failed', err);
            alert('Retry failed');
        }
    };

    return (
        <div data-test-id="webhook-config">
            <h2>Webhook Configuration</h2>
            
            <div style={{ marginBottom: '30px', padding: '20px', border: '1px solid #ddd' }}>
                 <div style={{ marginBottom: '10px' }}>
                    <label>Webhook URL: </label>
                    <input 
                        data-test-id="webhook-url-input"
                        type="url" 
                        value={webhookUrl} 
                        onChange={e => setWebhookUrl(e.target.value)}
                        placeholder="https://yoursite.com/webhook"
                        style={{ width: '300px', padding: '5px' }}
                    />
                 </div>
                 <div style={{ marginBottom: '10px' }}>
                    <label>Webhook Secret: </label>
                    <span data-test-id="webhook-secret" style={{ fontFamily: 'monospace', background: '#eee', padding: '2px 5px' }}>{secret}</span>
                    <button data-test-id="regenerate-secret-button" style={{ marginLeft: '10px' }} onClick={() => alert('Regenerated (Demo)')}>Regenerate</button>
                 </div>
                 <button data-test-id="save-webhook-button" onClick={() => alert('Saved (Demo)')}>Save Configuration</button>
                 <button data-test-id="test-webhook-button" style={{ marginLeft: '10px' }} onClick={() => alert('Test Webhook Sent (Demo)')}>Send Test Webhook</button>
            </div>

            <h3>Webhook Logs</h3>
            <table data-test-id="webhook-logs-table" style={{ width: '100%', borderCollapse: 'collapse' }}>
                <thead>
                    <tr style={{ background: '#f1f1f1',  textAlign: 'left' }}>
                        <th style={{ padding: '10px' }}>Event</th>
                        <th style={{ padding: '10px' }}>Status</th>
                        <th style={{ padding: '10px' }}>Attempts</th>
                        <th style={{ padding: '10px' }}>Last Attempt</th>
                        <th style={{ padding: '10px' }}>Code</th>
                        <th style={{ padding: '10px' }}>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {logs.map(log => (
                        <tr key={log.id} data-test-id="webhook-log-item" data-webhook-id={log.id} style={{ borderBottom: '1px solid #eee' }}>
                            <td data-test-id="webhook-event" style={{ padding: '10px' }}>{log.event}</td>
                            <td data-test-id="webhook-status" style={{ padding: '10px' }}>{log.status}</td>
                            <td data-test-id="webhook-attempts" style={{ padding: '10px' }}>{log.attempts}</td>
                            <td data-test-id="webhook-last-attempt" style={{ padding: '10px' }}>{new Date(log.last_attempt_at).toLocaleString()}</td>
                            <td data-test-id="webhook-response-code" style={{ padding: '10px' }}>{log.response_code || '-'}</td>
                            <td style={{ padding: '10px' }}>
                                <button 
                                    data-test-id="retry-webhook-button"
                                    data-webhook-id={log.id}
                                    onClick={() => handleRetry(log.id)}
                                >
                                    Retry
                                </button>
                            </td>
                        </tr>
                    ))}
                    {logs.length === 0 && <tr><td colSpan="6" style={{ padding: '20px', textAlign: 'center' }}>No logs yet</td></tr>}
                </tbody>
            </table>
        </div>
    );
};

export default Webhooks;
